import React from 'react';
import { useState, useEffect } from 'react';
import { check_token_validity, get_token, linkStyle, clearCookies } from './imports';
import { useNavigate } from 'react-router-dom';

const Search = () => {
  const navigate = useNavigate();
  const token = get_token();

  const [forYou, setForYou] = useState([]);

  function disconnect()
  {
    clearCookies();
    localStorage.removeItem('token');
    window.location.replace('http://localhost:3000/');
  } 

  const fetchOptions = {
    method: "POST",
    headers: {
      "Content-Type": "application/json",
      "Authorization": `Bearer ${token}`,
    },
    body: JSON.stringify({}),
  };

  useEffect(() => {
      check_token_validity(token)
      .then(result => {
        if ( token == undefined || result === 'expired' )
        {
            navigate('/');
            return;
        }
      })
      .catch(error => {
        console.error(error);
      });

      fetch(`http://localhost:8000/foryou/`, fetchOptions)
      .then((response) => response.json())
      .then((data) => setForYou(data));

      fetch(`http://localhost:8000/get_user/`, fetchOptions)
      .then((response) => response.json())
      .then((data) => setUser(data));

      return () => {
        // Cleanup logic (if needed)
      };

  }, []);

  const handleImageClick = (id) => {
    alert(`Clicked image with ID: ${id}`);
  };

  return (
        <div className="rounded-md shadow-md text-left font-b">
        <nav class="flex items-center justify-between flex-wrap p-6">
        <div class="flex items-center flex-shrink-0 text-white mr-6">
        <div> <img className='rounded-full w-12' src={require('./Image.jpeg')} alt ="PRP image" onClick={() => {navigate('/profile');}} style={linkStyle}/></div>
          <span class="ml-4 text-3xl tracking-tight max-sm:hidden lg:shown ">{user['username']}</span>
          <button className="max-sm:ml-4 ml-8 w-24 rounded-full border-2 border-gray-700 p-1 text-gray-500 hover:text-cyan-300 hover:border-cyan-300  transition duration-300 text-xl focus:outline-none" onClick={() => {disconnect();}}> DISCONNECT </button>
        </div>

        <div class="block">
        <form>   
        <label for="default-search" class="mb-2 text-sm font-medium text-gray-900 sr-only dark:text-white">Search</label>
        <div class="relative">
        <input type="search" id="default-search" className="lg:w-80 block max-sm:hidden w-full bg-transparent text-gray-700 focus:text-white rounded-full border-2 border-gray-700 p-2 focus:outline-none focus:border-cyan-300" placeholder="RECHERCHER" required/>
        <button type="submit" class="text-white absolute max-sm:bottom-0 end-3 bottom-3.5">
            <svg class="w-4 h-4 max-sm:w-6 max-sm:h-6 text-gray-500 dark:text-gray-400" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 20 20">
                <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="m19 19-4-4m0-7A7 7 0 1 1 1 8a7 7 0 0 1 14 0Z"/>
            </svg></button>
        </div>
        </form>
        </div>
      </nav>

      <div className="mt-5" style={backgroundStyle}>

      <div> 

        <div style={shadowBackgroundStyle}>

          <div key={popular.id} className="movie-container">
            <div className="grid grid-cols-3 gap-8">
              <div>
                <h1 className="text-6xl mt-8 ml-20 text-white">{popular.title}</h1>
                <p className="text-2xl mt-4 ml-20 text-gray-300">{popular.overview}</p>
              </div>
            </div>

            <button className="ml-20 mt-16 w-60 rounded-full border-2 border-cyan-300 p-1 text-cyan-300 hover:text-gray-300 hover:border-gray-300  transition duration-300 text-xl focus:outline-none"> RATE </button>

          </div>

        </div>

      </div>
    </div>

      <div className="mt-16">
        {forYou.length > 0 && (
          <>
            <h1 className="text-3xl mt-4 ml-10 text-white">POUR VOUS</h1>
            <div className="ml-8 mt-4 grid grid-cols-8 max-sm:grid-cols-2 max-md:grid-cols-4 max-lg:grid-cols-7 gap-3">
              {forYou.slice(0, 8).map((movie) => (
                <div key={movie.id} onClick={() => handleImageClick(movie.id)}>
                  <img
                    className="rounded-2xl hover:border-2 hover:border-gray-500 transition duration-300 w-full h-auto"
                    src={`https://image.tmdb.org/t/p/w500${movie.poster_path}`}
                    alt={movie.title}
                  />
                </div>
              ))}
            </div>
          </>
        )}
      </div>

      </div>
    );
  };
  export default Search;
